import React from "react";
import { useState, fetch, useEffect } from "react";

async function Test() {
  useEffect(() => {
    const [data, setData] = useState({});
    fetch("https://fakestoreapi.com/products/1")
      .then((res) => res.json())
      .then((json) => console.log(json));
  }, []);
  return <div></div>;
}

export default function Podaci() {
  return <Test />;
}
